import react from 'react'
import './CustomHeader.css'

const CustomHeader=() => {
    return(
        <header>
            <h1>Hello there! 
                <br></br>
                <p>I'm Dennis Bode</p>
            </h1>
        </header> 
    );
}
export default CustomHeader;
